function MovieBox(props) {
    
  return (
    <div className='movie-box'>
    <img src={props.show.image.medium}/>
        <div className='movie-box-text'>
            <>Name: {props.show.name}</>
            <button>KNOW MORE</button>
        </div>
    
    </div>
  )
}

export default MovieBox
